import * as services from "../services/personelServices";
import { useState, useEffect } from "react";

export default function PersonalPage() {
  const [personalList, setPersonalList] = useState([]);

  useEffect(() => {
    services.getPersonel().then((res) => {
      console.log("API Response:", res); // API yanıtını kontrol edin
      if (res && res.payload) {
        setPersonalList(res.payload);
      } else {
        console.error("Unexpected API response structure:", res);
      }
    }).catch((error) => {
      console.error("Error fetching personal data:", error);
    });
  }, []);

  return (
    <table>
      <thead>
        <tr>
          <th>Personel Adı</th>
          <th>Personel Soyadı</th>
          <th>Personel TC</th>
        </tr>
      </thead>
      <tbody>
        {personalList?.map((item, index) => (
          <tr key={index}>
            <td>{item?.personelName}</td>
            <td>{item?.personelSurname}</td>
            <td>{item?.personelSicilNo}</td>
          </tr>
        ))}
      </tbody>
    </table>
  );
}
